Adobe InDesign CS5 for Macintosh and Windows: Visual QuickStart Guide


Adobe InDesign CS5 for Macintosh and Windows: Visual QuickStart Guide highlights the important new features, as well as covering the ones readers have relied on in previous versions of InDesign. Complete coverage of InDesign CS5's new features includes: tools for interactive documents, including the new animation panel; simplified object selection; multiple page sizes; track text changes; new layers panel, live captions; production enhancements, and print to digital capability.
Using the task-based, visual approach that readers count on in the Visual QuickStart Guides, this volume introduces readers to all aspects of InDesign CS5. Users will learn how to create and automate documents, import and style text and objects, manage long documents, export files for a wide variety of purposes, and much more.


